import React, { Component } from 'react'

import './sign.css'

class SignUpPage extends Component {
  goToSignIn = () => {
    this.props.history.push('/signin')
  }

  render() {
    return (
    <div className="login-wrap">
      <div className="login-html">
        <input readOnly id="tab-2" type="radio" name="tab" className="sign-up" checked /><label htmlFor="tab-2" className="tab">Sign Up</label>
        <input onClick={this.goToSignIn} readOnly id="tab-1" type="radio" name="tab" className="sign-in" /><label htmlFor="tab-1" className="tab">Sign In</label>
        <input type="text"/>
    </div>
    </div>
  )}
}

export default SignUpPage
